const AddNonProfitPage = () => {
    return (
        <div className='add-non-profit-main'>
            <form>
                <label>Name</label>
                <input required></input>
                <label>Email</label>
                <input type='email' required></input>
                <label>Address</label>
                <input required></input>
                <button type='submit'>Submit</button>
                <button type='reset'>Clear</button>
            </form>
        </div>
    );
}

export default AddNonProfitPage;
